@TylerHubbard and I have spent the last few days reminiscing on these last 40 weeks and laughing at how we found out I was pregnant with baby #3. Finding out the way we did was quite a surprise to say the least and I’m so thankful I listened to our nanny and intuitions... Little buddy, we couldn’t be happier you’ll be coming into our world soon and have no doubts you’ll keep us on our toes like you have since they day we found out about you.  Saying we can’t wait to meet you would be an understatement. 

@thekatiesittersclub 
@annabraley

We’re still reliving Tuesday night and feeling so GRATEFUL for everyone that bought tickets, showed up, and contributed to making Together Feeding Nashville happen on Tuesday and selling out the very first show @firstbankamp 🎶
It took a village for this night to come together, so before I share anything else, we owe a huge special THANK YOU to everyone involved from the artists, to hosts, and band & crew, to all the many people behind the scenes.

✨ It was such an honor to get to work alongside the core group of women that believed in us when some people thought we were crazy for wanting to pull this off in such short notice in such a big way. They believed in us and @feedingnashville and I’m forever grateful because they’ve helped change so so many lives in doing so and raised over $450k 

